INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('7781', 'sfqygycqgzs', '是否启用共有产权告知书', NULL, NULL, NULL, NULL, NULL, '1', NULL, 'wx_gycqgz', NULL, NULL, NULL, 'fzgzc', NULL, '<p style="text-align:center"><strong><span style="font-size:20px;font-family:仿宋_GB2312">公证告知内容</span></strong></p><p><span style="font-size:20px;font-family:仿宋_GB2312">您将进行北京市方正公证处共有产权房选房顺序视频登记系统，请您确保本人自愿参与视频登记全过程，并如实提供本人相关登记材料。保证材料真实有效，并保证视频通话过程中所述内容属实，意思表示真实、合法并据此如实确认登记结果。</span></p><p><span style="font-size:20px;font-family:仿宋_GB2312">&nbsp;</span></p><p style="text-align:center"><strong><span style="font-size:20px;font-family:仿宋_GB2312">提交后提醒内容</span></strong></p><p style="text-align:left"><span style="font-size: 20px;font-family:仿宋_GB2312">信息提交成功，公证人员将通过本视频系统与您通话，您有义务保证与公证处的视频通话内容属实，意思表示真实、自愿，请您如实确认登记结果。公证处将对视频通话内容录音录像留存。</span></p><p><br/></p>', NULL);
