INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1942', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahslasgxgzc', NULL, '安徽省六安市皋翔公证处是经安徽省司法厅批准设立的我市城区唯一公证机构，该处不以营利为目的，依法独立行使公证职能，独立承担民事责任，业务范围包括国内、涉外及涉台港澳公证事项。', NULL);
INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1968', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahshsshpgzc', NULL, '黄山市恒平公证处（原黄山市公证处）拥有一支年轻的、高素质的公证人员队伍，所有公证员具有大学本科以上学历，法律知识功底过硬，工作经验丰富。是黄山市公证人员最多、公证业务范围最广、服务质量一流的公证法律服', NULL);
