INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('2046', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahsbzsjdgzc', NULL, '亳州市金铎公证处成立于2006年，其前身是亳州市公证处，目前是亳州市司法局领导下的城区内唯一的工作机构。金铎公证处从成立之初就始终坚持以“公平、公正、优质、高效”为宗旨。', NULL);
INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('2254', 'zxsb_ywxx', '在线申办-业务信息', NULL, NULL, '1', NULL, NULL, NULL, NULL, 'ymts', NULL, NULL, NULL, 'zjshzsqtgzc', NULL, '<p>如使用委托人代为办理，则代理人前往公证处代为办理及领证时也要带上自己的身份证原件及委托书，委托书手写即可，可参考如下格式：</p><p>本人xx,身份证xxxxxxxxxxxx，先委托xx前往xx公证处代为办理并领取公证书</p><p>委托人：xx</p><p>xx年xx月xx日</p>', NULL);
INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1772', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahshfshygzc', NULL, '安徽省合肥市徽元公证处坐落于地址，交通极为便利，我们的业务活动有：提供公证法律服务,本单位是国有企业,上年度营业收入：12762 资产总计:11223,我们将以国家级信用为你提供相关业务,欢迎大', NULL);
INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1812', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahshfszagzc', NULL, '合肥市中安公证处直属于合肥市司法局，曾被司法部授予“全国公证质量评比先进集体”和全国首批部级“文明公证处”等殊荣，被安徽省司法厅评为“全省公证质量优秀公证处”、“省级文明公证处”、“人民满意的公证处”等称号。', NULL);
