INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1734', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahsfyshygzc', NULL, '阜阳市惠颍公证处（原阜阳市公证处）成立于1996年 ，现拥有公证人员17人，其中执业公证员10人，行政辅助人员7人。80％以上人员具有本科学历，是一支整体素质高、爱岗敬业、无私奉献、团结战斗的集体。', NULL);
INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('2098', 'jj', '公证处简介', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ymtc', NULL, NULL, NULL, 'ahshnszcgzc', NULL, '安徽省淮南市正诚公证处坚持以人为本，认真抓好公证处队伍建设，引进了一批高素质法律人才充实公证队伍，通过各种培训学习不断提高公证人员的综合素质，加强对公证人员职业道德、执业纪律的教育和监督。', NULL);
