INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('8312', 'dzqmxy', '在线委托配置', NULL, NULL, NULL, NULL, NULL, '1', '0', 'zxwt', NULL, NULL, '0', 'ojzxfq', NULL, NULL, '<p style="text-align: center;"><strong><span style="font-family: 宋体;">电子认证服务使用须知</span></strong></p><p><strong><span style="font-family: 宋体;">尊敬的用户：</span></strong></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">数字证书用于标识网络用户的身份。安徽省电子认证管理中心有限责任公司（以下简称AHCA）作为依法设立并有效存续的第三方电子认证服务机构，为用户提供数字证书相关的电子认证服务。为明确各方权利和义务，AHCA与用户就数字证书申请、使用等事宜形成以下条款内容，双方共同遵守执行。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（一）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户确认，填写业务受理单之前，已认真阅读了本《AHCA电子认证服务条款》中各项内容。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（二）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户确认以AHCA官方网站（http://www.aheca.cn</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">）首页上公示的经信息化主管部门备案的《安徽省数字证书认证中心电子认证业务规则》为服务执行标准。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（三）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户在向AHCA或其所</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">委托各受理点按现场申办规程</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">办理申请手续时，须保证自己所提供的信息及资料的真实性、完整性和准确性，否则须全部承担由此造成相关各方损失</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（四）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">AHCA</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">委托各受理点在对用户提供的资料核对，并经用户确认无误后，向AHCA发出证书制作指令。AHCA收到各受理点指令后，及时签发数字证书，再由受理点将制作好的证书交付给用户。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（五）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">AHCA</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">签发的数字证书仅用于表明用户在申请证书时所要标识的身份，以及验证其使用该证书内包含的公钥所对应的私钥制作的签名。如果用户将该证书用于其他用途，AHCA不承担任何由此产生的责任和义务。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（六）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户应当妥善保管AHCA所签发的数字证书和私钥及保护密码。如上述信息因非AHCA或其委托代为受理人原因失密，则用户应当自行承担一切损失。如因AHCA过错，发生数字证书被伪造、篡改的， AHCA承担赔偿责任。赔偿方法参照《安徽省数字证书认证中心电子认证业务规则》。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（七）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">数字证书一律不得转让、转借或转用。因转让、转借或转用而产生的一切损失将由用户自行承担。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（八）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">数字证书的有效期自证书受理之日起计算。如用户拟在到期后继续使用数字证书，则须在到期前一个月内向AHCA或其受理点提出数字证书更新请求。否则，证书到期将自动失效，AHCA对此不承担任何责任。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（九）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">为了更好地服务客户，特别是保证用户数字证书的安全性，AHCA有权要求及时对用户数字证书进行升级。届时，用户在收到证书升级通知时，应在规定的期限内到AHCA或其受理点予以升级，否则对于因用户未进行技术升级所引起的后果由用户自行承担。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十）&nbsp;</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">如发生用户数字证书丢失，或数字证书失密，或证书中信息出现重大变更，或用户不希望继续使用数字证书、用户依法被吊销营业执照或清算等情况，用户应当立即向受理点或AHCA申请注销证书，注销手续遵循AHCA的规定。AHCA自接到用户直接提出或受理点转发的注销申请之时起，在24小时内注销用户的数字证书。用户应当承担在证书注销之前所有使用数字证书而造成的责任。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十一）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">您同意本公司向温州市东南公证处存在在线公证平台、有关部门和个人核实您的信息。本公司有权合法地收集、处理、传递及应用您的资料，并按照国家有关规定及本须知的约定对您的资料保密。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十二）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">对于下列情况之一，AHCA有权主动注销所签发的数字证书：</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 1)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户在申请办理数字证书时，提供虚假信息和资料；</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 2)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户未按照规定缴纳数字证书相关费用；</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 3)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">证书对应的私钥泄露或发生其他证书的安全性不能得到保证的情况；</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 4)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">用户不能履行或违反相关法律、法规和本条款及《安徽省数字证书认证中心电子认证业务规则》所规定的其他责任和义务；</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 5)<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">法律法规规定的其他情形。</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十三）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">如果产品需要升级，AHCA会通过网站进行公示通知，敬请用户随时密切关注发布在<a href="http://www.aheca.xn--cn-rv2ck54g8ob597bxgcp41f./">http://www.aheca.cn上的最新通知。</a></span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;"></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十四）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">本条款除期满终止外，并可因下列原因之一而提前终止：</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 1</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">）用户因不希望继续使用或依法被吊销营业执照或清算等情况而申请注销证书；</span></p><p style="text-indent: 29px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">&nbsp; 2</span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">）本条款期满前AHCA根据本条款第十一条规定主动注销用户证书。</span></p><p style="margin-left: 28px;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">因上述原因提前终止时，AHCA所收费用均不予退还。</span></p><p style="margin-left: 28px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十五）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">本条款生效后，AHCA及用户均应依诚实守信之原则履行条款项之全部义务，若因本条款的履行、解释、赔偿所产生的一切争议，经双方协商不能解决，任何一方均可将争议提交合肥仲裁委员会进行仲裁。</span></p><p style="margin-left: 28px;"><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">（十六）<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 15px; font-family: 宋体; letter-spacing: 0px;">本条款自双方签字或盖章之日起生效，有效期为一年。</span></p><p><br/></p><p><br/></p>');
