INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('5987', 'sfqygzs', '是否启用告知书', NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, '00612762-7', NULL, '<p style="white-space: normal;">一、本平台打破时间和空间的限制，使公证处实现“24小时”不打烊，当事人可以随时随地申办，根据提示，线上选择公证事项、填写信息、上传的材料以及费用系统会根据当事人选择的公证事项分别筛选和计算出来，当事人可利用平台完成线上缴费，从而实现足不出户即能享受方便、快捷、优质、高效的公证法律服务。&nbsp;</p><p style="white-space: normal;">二、人性化服务：在平台后台，公证人员会及时处理当事人的在线申请，解答在线咨询，并在必要时与当事人进行电话沟通，帮助当事人轻松、便捷地使用公证平台，提供给当事人人性化的服务。&nbsp;</p><p style="white-space: normal;">三、温馨提示：</p><p style="white-space: normal;">1、为便于为您提供优质服务，在使用平台过程中，请您务必使用真名注册，并按照要求提供所需真实、合法的证明材料；</p><p style="white-space: normal;">2、若网上受理上传资料不齐全，按照公证人员电话沟通要求，在取件时补齐证明资料。</p><p><br/></p>', NULL);
