INSERT INTO "GGFLFW_WX"."T_GZ_CSSZ" VALUES ('1', 'sfqygzs', '是否启用告知书', NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, '/0LK', NULL, '<p>公证当事人：</p><p>根据《公证程序规则》第21条的规定，就公证当事人在办理公证过程中的有关权利、义务告知如下：</p><p>一、公证当事人在办理公证过程中享有的有关权利</p><p>1.可以对公证机构指派的承办公证员要求回避。</p><p>2.有权询问和了解所办公证事项的法律意义和法律后果。</p><p>3.有权对公证员的询问笔录中自己的回答进行核对和修改。</p><p>4.有权在符合法律援助条件时按照规定申请减、免公证费。</p><p>5.有权在公证书出具前撤回公证申请。<br/>（注：如一旦受理通过，公证处已开始制作公证书，此时撤销公证申请需到公证处协商处理，不可线上撤回。）</p><p>6.在公证机构决定受理、不予办理或终止公证时，有权获得书面通知。</p><p>7.有权要求公证机构按期出具公证书。</p><p>8.有权申请更正公证书中的文字性错误；如认为公证书证明有错误，有权自收到公证书之日起一年内提出复查；有权在因公证机构执业过错受到损失时要求获得赔偿。</p><p>二、公证当事人在办理公证过程中承担的有关义务</p><p>1.如实陈述、填写申请表、提交真实、合法、充分的证明材料，提供虚假证明材料、做虚假陈述或用其他手段欺骗公证机构的，一经发现材料扣留，公证费不予退还，公证机构有权追究相应责任。因欺骗公证机构、骗取公证书给自己或他人造成损失的，要承担赔偿责任。</p><p>2. 应按照规定交纳公证费，已受理的公证事项,申请人撤回公证申请的,未经审查的,每件收取10元；已经审查或因当事人的原因终止公证的，按照该公证事项收费标准的50%收取。</p><p>3.处分类财产公证事项按《公证程序规则》第35条规定，自受理之日起十五个工作日内出公证书，因不可抗力、补充证明材料或者需要核实有关情况的，所需时间不计算在内。</p><p>4、当事人要配合公证员的核实工作，公证处有权向相关机构核实当事人提交的材料的真实性，包括但不限于身份证等个人信息。</p><p>5、外调核实费用由当事人预交，外调后凭票多退少补。已外调事项因当事人原因不能办理的，外调费不退。</p><p><br/></p>', NULL);
